import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from "react-redux";
import { Link } from 'react-router-dom';
import classes from './Search.module.css';
import footer_logo from '../app_bar/東大金融研究会_ロゴ.png';
import App_bar from '../app_bar/App_bar';

import {
    selectSheet,
    getSpredSheet,
} from "../company/companySlice";


const Search = () => {
    const dispatch = useDispatch();
    const sheet = useSelector(selectSheet);
    const other_id = (number) => {
        let dir = window.location.href.split("/");
        let dir2 = dir[dir.length - number];
        return dir2;
    }
    const taget_cate = other_id(2) == 'search' ? '' : decodeURI(other_id(2))
    const target_company = sheet.info.elements.filter((output) => {
        return output.分類;
    })


    useEffect(async() => {
        const res = await dispatch(getSpredSheet())
    }, []);

    return (
        <div>
            <header>
                <App_bar sheet={sheet}/>
            </header>
            <div className={classes.company_head}>
                東大生が注目する企業{sheet.info.elements.length}社
            </div>
            <div style={{marginLeft: '20px'}}>参照: {sheet.info.elements.length}社 {Object.keys(sheet).length}記事</div>
            <div className={classes.content}>
                <div className={classes.right_box}>
                    <div className={classes.right_box_box}>
                        <div className={classes.search_head}>
                            業界検索
                        </div>
                        <ul>
                            <Link to={`/search/商社/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>商社</li>
                            </Link>
                            <Link to={`/search/コンサル/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>コンサル</li>
                            </Link>
                            <Link to={`/search/シンクタンク/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>シンクタンク</li>
                            </Link>
                            <Link to={`/search/不動産/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>不動産</li>
                            </Link>
                            <Link to={`/search/メーカー/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>メーカー</li>
                            </Link>
                            <Link to={`/search/その他/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>その他</li>
                            </Link>    
                        </ul>  
                        <div className={classes.search_head}>
                            属性比較
                        </div>
                        <ul>
                            <Link to={`/property/給与/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>給与</li>
                            </Link>
                            <Link to={`/property/休暇/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>休暇</li>
                            </Link>
                            <Link to={`/property/勤務地/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                                <li>勤務地</li>
                            </Link>
                        </ul>             
                    </div>
                </div>
                <div className={classes.left_box}>
                <div className={classes.company_head}>
                    企業一覧
                </div>
                    {sheet.info.elements[0].企業名 != '' &&
                        target_company.map((each_info) => (
                            <Link to={`/company/${each_info.ローマ字}/`}　className={classes.company_box} style={{ textDecoration: 'none', color: '#424242' }}>
                                <span className={classes.company_font}>{each_info.企業名}</span>
                                <br/>
                            </Link>
                        ))
                    }
                </div>
            </div>
            <footer className={classes.footer_box}>
                <img src={footer_logo} className={classes.logo}/>
            </footer>
        </div>
    )
}

export default Search
